import axios from "axios";

export default {
    search: function(query) {
        return axios.get("https://www.googleapis.com/books/v1/volumes?q=" + query);
    },
    saveBook: function(bookInfo) {
        return axios.post(`/${bookInfo.id}`);
    }
};
